import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PatientForm from './components/PatientForm'; // Import PatientForm component
import DoctorForm from './components/DoctorForm'; // Import DoctorForm component

// Header Component
const Header = () => {
  return (
    <header>
      <div className="logo">
        <img src="placeholder-logo.png" alt="Doctro Logo" />
      </div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/patient-form">Patient Form</Link>
          </li>
          <li>
            <Link to="/doctor-form">Doctor Form</Link>
          </li>
        </ul>
      </nav>
    </header>
  );
};

// Main App Component
const App = () => {
  const [showForm, setShowForm] = useState(false);

  const toggleForm = () => {
    setShowForm(!showForm);
  };

  return (
    <Router>
      <div className="App">
        {/* Header */}
        <Header />

        {/* Button to toggle form visibility */}
        <button onClick={toggleForm}>
          {showForm ? 'Hide Form' : 'Show Form'}
        </button>

        {/* Conditional Rendering of Forms */}
        {showForm && (
          <Routes>
            <Route path="/patient-form" element={<PatientForm />} />
            <Route path="/doctor-form" element={<DoctorForm />} />
          </Routes>
        )}

        {/* Main Content */}
        <div className="content">
          <section className="intro">
            <h1>Welcome to Doctro</h1>
            <p>Your health management platform.</p>
          </section>

          <section className="mission">
            <h2>Our Mission</h2>
            <p>Providing accessible healthcare services to everyone.</p>
          </section>

          <section className="services">
            <h2>Our Services</h2>
            <ul>
              <li>Appointment Booking</li>
              <li>Live Queue Tracking</li>
              <li>Emergency Services</li>
              <li>Telemedicine</li>
            </ul>
          </section>
        </div>
      </div>
    </Router>
  );
};

export default App;
